import { observer } from 'mobx-react-lite';
import NavBar from '../../features/navbar/NavBar';

function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <header className="App-header">
        <h1>hello world</h1>
      </header>
    </div>
  );
}

export default observer(App);
